import {Link} from 'react-router-dom'


export default class Footer extends Component{
render(){

    return (
        <footer className="ui grid centered" style={{ marginTop:' 60vh',
         width:'100%',
          background:'black',
          padding: '10px'
        
        }}>
        <Link to="/home">Home</Link>
        <p className="sixteen wide" style={{color:'white', marmarginBottom: '0'}}>@copyright, 2020</p>
        
        </footer>


    )
}


}
